import React from 'react';
import './App.css';
import Typical from 'react-typical';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Typical steps={['Bienvenue',1000,'Veuillez choisir votre profil',500]}/>
      </header>
    </div>
  );
}

export default App;
